Mongoose Populate Returning ObjectIds and Empty Arrays<p>I have an Collection Model that has a property of items that holds an array of Item Models.</p>
<pre><code>const CollectionSchema = new mongoose.Schema({
    title: {
        type: String,
        required: true
    },
    items : [{type : mongoose.Schema.Types.ObjectId, ref: 'Item'}]
});
</code></pre>
<p>I tried to populate the items array in order to get the objectId's properties, but the items array would return back empty. (The code below is how I populated the items array. I first found the collection I was looking for by the _id using the req.body.search. I then ran .populate(&quot;items&quot;) in order to populate the items array. What I got back was an empty items array.)</p>
<pre><code>userRouter.post('/iList', passport.authenticate('jwt', {session: false}), (req, res) =&gt; {
    Collection.findById({_id : req.body.search}).populate(&quot;items&quot;).exec((err, document) =&gt; {
        if(err)
            res.json(err)
        else
            res.json({item: document})
    })
});
</code></pre>
<p>I know my items array isn't empty since I can check on mongoDB that it is full.
<a href="https://i.stack.imgur.com/hYrrK.png" rel="nofollow noreferrer">The image of my mongoDB collection with an items array that isn't empty.</a></p>
<p>The weird thing is that if I put &quot;collections&quot; into the .populate params, my Items array does return with stuff, but it only returns the ObjectIDs and not actual object properties. I am confused to why .populate(&quot;items&quot;) isn't working.</p>

